import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

const GamePage = () => {
    const { title } = useParams(); // Получаем название сессии из URL
    const [sessions, setSessions] = useState([]);

    useEffect(() => {
        // Функция для загрузки списка сессий
        const fetchSessions = async () => {
            try {
                const response = await fetch('/sessions/active');
                if (!response.ok) {
                    throw new Error(`HTTP error! status: ${response.status}`);
                }
                const data = await response.json();
                setSessions(data);
            } catch (error) {
                console.error("Error fetching sessions:", error);
            }
        };

        fetchSessions();
    }, []);

    return (
        <div>
            <h2>Игровая сессия: {sessions.title}</h2>
            <h3>Пользователи в сессии:</h3>
            <ul>
                {sessions.users.map((user, index) => (
                    <li key={index}>{user.name}</li> // Предполагаем, что у пользователя есть свойство name
                ))}
            </ul>
        </div>
    );
}

export default GamePage;
